import React from 'react';
import TodoItem from './TodoItem';

const TodoList = ({ todos }) => {
	let style;

	if (!todos) style = { display: 'none' };
	return (
		<ul className="todo-list" style={style}>
			{todos.map((todo) => {
				return <TodoItem key={todo} todo={todo} />;
			})}
		</ul>
	);
};

export default TodoList;
